uccessful. Due to the cost to the business, it isnâ€™t possible to run the promotion in all regions. The marketing team would like to target 10 other regions that have similar buying habits to Saint Petersburg where they would expect the promotion to be similarly successful.\n","\n","### The data\n","The marketing team has sourced you with historical sales volumes per capita for several different drinks types.\n","\n","- \"year\" - year (1998-2016)\n","- \"region\" - name of a federal subject of Russia. It could be oblast, republic, krai, autonomous okrug, federal city and a single autonomous oblast\n","- \"wine\" - sale of wine in litres by year per capita\n","- \"beer\" - sale of beer in litres by year per capita\n","- \"vodka\" - sale of vodka in litres by year per capita\n","- \"champagne\" - sale of champagne in litres by year per capita\n","- \"brandy\" - sale of brandy in litres by year per capita"]},{"cell_type":"code","execution_count":1,"id":"37e3a925","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-03-10T13:17:50.341601Z","iopub.status.busy":"2023-03-10T13:17:50.338289Z","iopub.status.idle":"2023-03-10T13:17:52.067802Z","shell.execute_reply":"2023-03-10T13:17:52.065603Z"},"papermill":{"duration":1.776925,"end_time":"2023-03-10T13:17:52.06799","exception":false,"start_time":"2023-03-10T13:17:50.291065","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["â”€â”€ \u001b[1mAttaching packages\u001b[22m â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€ tidyverse 1.3.1 â”€â”€\n","\n","\u001b[32mâœ”\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32mâœ”\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32mâœ”\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32mâœ”\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32mâœ”\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32mâœ”\u001