svc = sum(svc)) %>%\n","  ungroup() %>%\n","  mutate(drink = \"Total\")\n","\n","data_st_petersburg %>%\n","  bind_rows(data_st_petersburg_tot) %>%\n","  mutate(drink = fct_reorder(drink, svc)) %>% \n","  ggplot(aes(x = year, y = svc, color = drink)) +\n","  geom_line() +\n","  geom_point() +\n","  geom_hline(aes(yintercept = 0), linetype = \"blank\") + \n","  facet_wrap(~ drink, scales = \"free_y\") +\n","  theme(legend.position = \"None\") +\n","  labs(\n","    x = \"Year\",\n","    y = \"SVC (litres by year per capita)\",\n","    title = \"Saint Petersburg drink sales...\",\n","    subtitle = \"...some notes are presented after the plot.\",\n","    color = \"Drinks\"\n","  )"]},{"cell_type":"markdown","id":"cb859259","metadata":{"papermill":{"duration":0.064275,"end_time":"2023-03-10T13:17:54.919087","exception":false,"start_time":"2023-03-10T13:17:54.854812","status":"completed"},"tags":[]},"source":["Brandy, champagne, and wine show similar sales. However, vodka and beer show an increase some year ago and them fall. Considering that vodka and beer sales are higher than the rest of drinks, them behavior is more influential and the total sales show almost the same shape of them.\n","\n","## Modeling Data\n","\n","Our strategy to apply the clustering technique will be split our model into two steeps:\n","\n","- 1st: region selection considering Saint Petersburg market size and behavior; and,\n","\n","- 2nd: drink selection considering Wine in Saint Peterburg on the region of 1st steep.\n","\n","On each steep we will try to find the closer number of regions and drinks that our marketing team ask plus one (10 + 1), considering Saint Petersburg is the plus one. Let's do some data wrangling!"]},{"cell_type":"code","execution_count":5,"id":"6a512613","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2023-03-10T13:17:55.052219Z","iopub.status.busy":"2023-03-10T13:17:55.050824Z","iopub.status.idle":"2023-03-10T13:17:55.101761Z","shell.execute_reply":"2023-03-10T13:17:55.100519Z"},"papermill":{"duration":0.119046,"end_time":"2023-03-10T13:17:55.101923","exception":false,"start_time":"2023-03-10T13:17:54.982877","status":"completed"},"tags":[]},"outputs":[],"source":["# Reshaping the data\n","data_cluster_drink <- data_clean %>%\n","  pivot_wider(names_from = year, values_from = svc)\n","\n","data_cluster_tot <- data_cluster_drink %>%\n","  group_by(region) %>%\n","  summarize(across(where(is.numeric), ~ sum(.x))) %>%\n","  ungroup()\n","  \n","data_cluster_tot_ <- data_cluster_tot %>% select(-1)"]},{"cell_type":"markdown","id":"a6e3ccca","metadata":{"papermill":{"duration":0.064422,"end_time":"2023-03-10T13:17:55.231813","exception":false,"start_time":"2023-03-10T13:17:55.167391","status":"completed"},"tags":[]},"source":["Fine, our data now is prepared to apply the cluster techniques. Let's start with all data and Hierarchical Cluster!"]},{"cell_type":"code","execution_count":6,"id":"c4302620","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2023-03-10T13:17:55.368374Z","iopub.status.busy":"2023-03-10T13:17:55.366671Z","iopub.status.idle":"2023-03-10T13:17:56.629997Z","shell.execute_reply":"2023-03-10T13:17:56.630894Z"},"papermill":{"duration":1.334932,"end_time":"2023-03-10T13:17:56.631197","exception":false,"start_time":"2023-03-10T13:17:55.296265","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABkAAAAPdCAIAAABdrjPKAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzddWDTaB8H8Cdt13XuY8bQwRg+dLjLMVxe4NA7Dj3cxuF2wAHH4dzhd7i7Dhnu\nDsM3BkyYe1fL+0e6rmvTrratwPfzV0iepL88SZ6Q3548oWiaJgAAAAAAAAAAAOaKU9wBAAAA\nAAAAAAAAaIMEFgAAAAAAAAAAmDUksAAAAAAAAAAAwKwhgQUAAAAAAAAAAGYNCSwAAAAAAAAA\nADBrSGABAAAAAAAAAIBZQwILAAAAAAAAAADMGhJYAAAAAAAAAABg1pDAAgAAAAAAAAAAs4YE\nFgAAAAAAAAAAmDUksAAAAAAAAAAAwKwhgQUAAAAAAAAAAGYNCSwAAAAAAAAAADBrSGABAAAA\nAAAAAIBZQwKrcMWHX1k2e1K3to3KlvJxsrfh8QUOTq4VqtXt1GfYyq2Ho7OlhffTT5bUoSiK\noiivoNOF9ysmsbKGGxMqz9IjTizTeT26uZMVs6J9ydGmCuYrqjcw2Pt7F1YvnNKpWVCAX