AAAAAAyBoSWAAAAAAAAAAAIGtIYAEAAAAAAAAAgKwhgQUAAAAAAAAAALKG\nBBYAAAAAAAAAAMgaElgAAAAAAAAAACBrSGABAAAAAAAAAICsIYEFAAAAAAAAAACyhgQWAAAA\nAAAAAADIGhJYAAAAAAAAAAAga0hgAQAAAAAAAACArCGBBQAAAAAAAAAAsoYEFgAAAAAAAAAA\nyBoSWAAAAAAAAAAAIGtIYAEAAAAAAAAAgKwhgQUAAAAAAAAAALKGBBYAAAAAAAAAAMgaElgA\nAAAAAAAAACBrSGABAAAAAAAAAICs/R9pfOk8uEtrlQAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":494.4,"width":800}},"output_type":"display_data"}],"source":["# Reshaping the data\n","data_cluster_drink_filter <- data_cluster_drink %>%\n","  semi_join(data_cluster_tot_hc_filter, by = \"region\") %>%\n","  filter(region == \"Saint Petersburg\" & drink == \"Wine\" | region != \"Saint Petersburg\")\n","\n","data_cluster_drink_filter_ <- data_cluster_drink_filter %>% select(-1:-2)\n","\n","# Creating the Hierarchical Cluster\n","dist_mdl2 <- dist(data_cluster_drink_filter_, method = \"euclidean\")\n","\n","hc_mdl2 <- hclust(dist_mdl2, method = \"average\")\n","\n","# Cutting the model until we can analyze the cluster\n","k = 2\n","n = 51\n","\n","while (n > 11) {\n","  \n","  k = k + 1\n","  \n","  hc_mdl_cut2 <- cutree(hc_mdl2, k = k)\n","  \n","  data_cluster_drink_filter_hc <- data_cluster_drink_filter %>% transmute(region, drink, cluster = hc_mdl_cut2)\n","\n","  data_cluster_drink_filter_hc_filter <- data_cluster_drink_filter_hc %>%\n","      semi_join(\n","        filter(data_cluster_drink_filter_hc, region == \"Saint Petersburg\"),\n","        by = \"cluster\")\n","\n","  n = pull(count(data_cluster_drink_filter_hc_filter))\n","}\n","\n","# Selecting the correct model\n","hc_mdl_cut2 <- cutree(hc_mdl2, k = k)\n","\n","data_cluster_drink_filter_hc <- data_cluster_drink_filter %>% transmute(region, drink, cluster = hc_mdl_cut2)\n","\n","data_cluster_drink_filter_hc_filter <- data_cluster_drink_filter_hc %>%\n","    semi_join(\n","      filter(data_cluster_drink_filter_hc, region == \"Saint Petersburg\"),\n","      by = \"cluster\")\n","\n","# Ploting the results\n","drink_result <- data_cluster_drink %>%\n","  semi_join(data_cluster_drink_filter_hc_filter, by = c(\"region\",\"drink\")) %>%\n","  pivot_longer(\"1998\":\"2016\", names_to = \"year\", values_to = \"svc\") %>%\n","  mutate(year = as.numeric(year),\n","         region_drink = str_c(region, drink, sep = \" - \"))\n","\n","drink_result %>% ggplot(aes(x = year, y = svc)) +\n","  geom_line(data = rename(drink_result, region_drink2 = region_drink), aes(group = region_drink2), color = \"grey\") +\n","  geom_line(data = filter(rename(drink_result, region_drink2 = region_drink), region == \"Saint Petersburg\"), aes(group = region_drink2), color = \"black\") +\n","  geom_line(color = \"red\")+\n","  geom_hline(aes(yintercept = 0), linetype = \"blank\") +\n","  facet_wrap(~ region_drink) +\n","  labs(\n","    x = \"Year\",\n","    y = \"Sales Volume per Capita (SVC)\",\n","    title = \"Sales Volume per Capita by Regions and Drink\",\n","    subtitle = \"Red line: region - drink sales / Black line: Saint Peterburg - Wine sales\"\n","  )"]},{"cell_type":"markdown","id":"3fe952ce","metadata":{"papermill":{"duration":0.093477,"end_time":"2023-03-10T13:17:59.121154","exception":false,"start_time":"2023-03-10T13:17:59.027677","status":"completed"},"tags":[]},"source":["Summarizing, on the first steep we select some regions then, on the second step, we select some drinks based on wine sales in Saint Petersburg. There are two regions with big names. Let's present the regions and drink names below!"]},{"cell_type":"code","execution_count":9,"id":"65176985","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2023-03-10T13:17:59.314776Z","iopub.status.busy":"2023-03-10T13:17:59.312524Z","iopub.status.idle":"2023-03-10T13:17:59.338819Z","shell.execute_reply":"2023-03-10T13:17:59.33697Z"},"papermill":{"duration":0.125676,"end_time":"2023-03-10T13:17:59.338994","exception":false,"start_time":"2023-03-10T13:17:59.213318","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\n","Table: Regions and drink select on 2nd steep\n","\n","|Regions                               |Drink     |\n","|:-------------------------------------|:---------|\n","|Zabaykalsky Krai                      |Wine      |\n","|Ivanovo Oblast                        |Wine      |\n","|Moscow                                |Wine      |\n","|Moscow                                |Champagne |\n","|Komi Republic                         |Wine      |\n","|Saint Petersburg                      |Wine      |\n","|Sverdlovsk Oblast                     |Wine      |\n","|Tyumen Oblast                         |Wine      |\n","|Khantyâ€“Mansi Autonomous Okrug â€“ Yugra |Wine      |\n","|Chelyabinsk Oblast                    |Wine      |\n","|Yamalo-Nenets Autonomous Okrug        |Wine      |"]},"metadata":{},"output_type":"display_data"}],"source":["kable(unique(select(drink_result, region, drink)), col.names = c(\"Regions\",\"Drink\"), caption = \"Regions and drink select on 2nd steep\")"]},{"cell_type":"markdown","id":"ae1cbffc","metadata":{"papermill":{"duration":0.099265,"end_time":"2023-03-10T13:17:59.534523","exception":false,"start_time":"2023-03-10T13:17:59.435258","status":"completed"},"tags":[]},"source":["## Results\n","\n","We select ten pairs of region and drink to run our promotion only using the data available. Before we present these results, it is important to say some changes and improvements that could be made:\n","\n","- if more data is available, our model could be more robust. Information about market in each region could show other results. For example, number of customers, profits, taxes, logistics costs, and many others, could be used to generate value for our analysis.\n","\n","- other strategy could be apply with this same model is reduce the time window. For example, we can use different number of years and select the regions and drinks that appear more times.\n","\n","- on the other hand, we could try other algorithm like k-means to cluster and them apply the same cut strategy."]},{"cell_type":"code","execution_count":10,"id":"2ab7d9b3","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2023-03-10T13:17:59.756691Z","iopub.status.busy":"2023-03-10T13:17:59.755736Z","iopub.status.idle":"2023-03-10T13:18:00.797409Z","shell.execute_reply":"2023-03-10T13:18:00.79793Z"},"papermill":{"duration":1.155585,"end_time":"2023-03-10T13:18:00.798114","exception":false,"start_time":"2023-03-10T13:17:59.642529","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABkAAAAPdCAIAAABdrjPKAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzddWDUZh8H8Cdntau3UKNQoEhxd/dRXAYM3QsMt+FDBwwYYwyGbsN1uGsHFBnu\nUijSUqDUXc/y/pHrcb3LpWftXcf381eaPHny5EmeJ5dfkycUTdMEAAAAAAAAAADAWvEsXQAA\nAAAAAAAAAAAuCGABAAAAAAAAAIBVQwALAAAAAAAAAACsGgJYAAAAAAAAAABg1RDAAgAAAAAA\nAAAAq4YAFgAAAAAAAAAAWDUEsAAAAAAAAAAAwKohgAUAAAAAAAAAAFYNASwAAAAAAAAAALBq\nCGABAAAAAAAAAIBVQwALAAAAAAAAAACsGgJYAAAAAAAAAABg1RDAAgAAAAAAAAAAq4YAFgAA\nAAAAAAAAWDUEsPR1Y3QQpQcbBycvvzKN2/X4fuHahx8zLV1qdqp9qTTsuqXLAsVV5LE2zFnk\nWeWopctipH2VPZhdaH/uvaHrFlIjCna3Z7Jd8j7djNlC4UF3qr/Hy+sxdeXT6IylywIAAAAA\nxY/A0gX4r5Fkpcdmpcd+fHcj5OiqH6f2nr5u65JvHXiUpcv1Rfv36KH3uTJCSLUuvYLscc4b\nAFUHQNAQAAAAAACsAH6IFyJakXtg2fDHkZlheycggmVBq0YMPpiQRQhZHJUWZO9o6eIUJ6g6\nAIKGAAAAAABgBRDAMphIXCPuQyjrIlouzUhPjnjx4NjO33/dc52maULIy30TRw/vtbGNb9EW\nk4vIycPLy4sQ4uEstHRZAIolNCJg4EwAAAAAACgaCGAZge/s7KxrmYubh1/pwGYd+n7duH/9\nsfuYmXv/t35j5JKiKl7B6iy/8mm5pQsBUJyhEQEDZwIAAAAAQNHAIO6Fpd6YPSO8xcx0+vuV\n8VKFZcsDAAAAAAAAAFBMIYBVeKgR/QOYKVqRey9DatnSWAqtyIz++D7pS919XRKeF+IHy1Dn\nhce4A2edRyQpKTVHIjcxk0I9k3OSYpNSMxH7V7HOEwkAAAAAoGgggFWInKt+ftMwTa7zLizt\n9bVV8ye2qlutlJeHra1jQKUabb/qMePnLS9TJAVugpalHP5jaY8Wdct4u4vsnEqXD+r+vxnH\nbn5kltrzeRRF2bm21Vjr3qyaBX33XXH72LbJw3pUq1TO00UscnD2C6jQLPibpRv2xkh07kjk\nsTZMtk02vSCESFIeTfrmq1LOrr5+/u6OIjuxS+mg+gPGzL8Ulsy1R4qs0EMbh/fvWr28v6uT\ng8DG3qOkb/1WXab89GdYYm6BFaJO9cl2ZvRlQsgcfydmTvPtr8yyy9xebW/ObK7l32+YOfeP\nre3YsLqHWORTbyQz51KPskyaOgsf6sonK34Pk8bGsY7GIrPUuTYDqy5vf0P